<script setup lang="ts">
import { useVSPCaptcha } from "vue-simple-popups";
import { VSPSlideCaptcha } from "vue-simple-popups/templates";

const { showCaptcha } = useVSPCaptcha();
</script>
<template>
  <div class="flex gap-2">
    <button
      class="btn btn-primary"
      @click="
        () => {
          const closeCaptcha = showCaptcha(VSPSlideCaptcha, {
            width: 300,
            height: 200,
            picture:
              'data:image/jpeg;base64,',
            tile: 'data:image/png;base64,',
            y: 128,
            onCancel() {
              closeCaptcha();
            },
            onFinished() {
              closeCaptcha();
            },
          });
        }
      "
    >
      Basic Captcha
    </button>
  </div>
</template>
